import React from 'react';

export const MakeupCard = ({makeup}) => {
  return(
    <article>
      <img src={makeup.image_link}></img>
      <h2>{makeup.brand}</h2>
      <h3>{makeup.name}</h3>
    </article>
  );
};

export default MakeupCard;
